import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import API from '../services/api';

const Dashboard = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    agents: 0,
    lists: 0,
    items: 0
  });
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      const [agentsRes, listsRes] = await Promise.all([
        API.get('/api/agents'),
        API.get('/api/lists')
      ]);
      
      const totalItems = listsRes.data.reduce((sum, list) => sum + list.items.length, 0);
      
      setStats({
        agents: agentsRes.data.length,
        lists: listsRes.data.length,
        items: totalItems
      });
    } catch (error) {
      console.error('Error fetching stats:', error);
    }
    setLoading(false);
  };

  if (loading) {
    return (
      <div className="loading">
        <div className="spinner"></div>
      </div>
    );
  }

  return (
    <div className="slide-up">
      <h1 style={styles.title}>Dashboard Overview</h1>
      
      <div className="dashboard-grid">
        <div 
          className="dashboard-card"
          onClick={() => navigate('/agents')}
          style={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' }}
        >
          <h3>ðŸ‘¥ Agents</h3>
          <p style={styles.stat}>{stats.agents} Registered</p>
          <p>Manage your team members</p>
        </div>
        
        <div 
          className="dashboard-card"
          onClick={() => navigate('/upload')}
          style={{ background: 'linear-gradient(135deg, #56ab2f 0%, #a8e6cf 100%)' }}
        >
          <h3>ðŸ“Š Lists</h3>
          <p style={styles.stat}>{stats.lists} Uploaded</p>
          <p>Upload and distribute CSV files</p>
        </div>
        
        <div 
          className="dashboard-card"
          onClick={() => navigate('/distributed')}
          style={{ background: 'linear-gradient(135deg, #ff6b6b 0%, #ee5a24 100%)' }}
        >
          <h3>ðŸ“‹ Items</h3>
          <p style={styles.stat}>{stats.items} Distributed</p>
          <p>View distributed items to agents</p>
        </div>
      </div>

      <div className="card" style={styles.quickActions}>
        <h3>Quick Actions</h3>
        <div style={styles.actionButtons}>
          <button 
            className="btn btn-primary"
            onClick={() => navigate('/agents')}
          >
            Add New Agent
          </button>
          <button 
            className="btn btn-success"
            onClick={() => navigate('/upload')}
          >
            Upload List
          </button>
          <button 
            className="btn btn-primary"
            onClick={() => navigate('/distributed')}
          >
            View Distribution
          </button>
        </div>
      </div>
    </div>
  );
};

const styles = {
  title: {
    marginBottom: '25px',
    color: 'white',
    textAlign: 'center',
    fontSize: '2.5rem',
    textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
  },
  stat: {
    fontSize: '2rem',
    fontWeight: 'bold',
    margin: '15px 0',
    textShadow: '1px 1px 2px rgba(0,0,0,0.3)'
  },
  quickActions: {
    marginTop: '40px',
    background: 'rgba(255, 255, 255, 0.95)',
    backdropFilter: 'blur(10px)'
  },
  actionButtons: {
    display: 'flex',
    gap: '15px',
    marginTop: '20px',
    flexWrap: 'wrap',
    justifyContent: 'center'
  }
};

export default Dashboard;
